import React from "react";
import "../css/Header.css";
import SearchIcon from "@material-ui/icons/Search";
import ShoppingBasketIcon from "@material-ui/icons/ShoppingBasket";
import { Link } from "react-router-dom";
import logo from "../images/highqLogo.png";
import ArrowDropDownIcon from "@material-ui/icons/ArrowDropDown";
function Header() {
  return (
    <div className="header">
      <Link to="/">
        <img className="header-img" src={logo}></img>
      </Link>

      <div className="header-search">
        <input className="search-input" type="text"></input>
        <SearchIcon className="header-searchIcon" />
      </div>
      <div className="header-nav">
        <div className="option white-bg">
          Login <ArrowDropDownIcon />
        </div>
        <div className="option black-bg">
          <span>Track Order</span>
        </div>
        <Link to="/checkout">
          <div className="header-optionBasket">
            <ShoppingBasketIcon />
            <span className="option-line2 basket-count">0</span>
          </div>
        </Link>
      </div>
    </div>
  );
}

export default Header;
